import{_ as i,o as l,c as t,U as e}from"./chunks/framework.a0f12ab5.js";const W=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"translation/c/WG14-C/index.md","filePath":"translation/c/WG14-C/index.md","lastUpdated":1676126774000}'),a={name:"translation/c/WG14-C/index.md"},n=e("<p>ISO/IEC JTC1/SC22/WG14はプログラミング言語Cの国際標準化ワーキンググループです。</p><p>現在のC言語規格（C17）ISO/IEC 9899は、2018年にISOとIECで採択されました。</p><p>国際規格を入手する場合は、各国の会員団体にお問い合わせください。</p><p>プロジェクトとそのマイルストーンに関わる仕事は以下の通りです。</p><ul><li>9899: プログラミング言語 C</li><li>不具合報告・対応記録</li><li>TR 18037: 組み込みC</li><li>TR 19769: 新しい文字データ型をサポートするためのプログラミング言語Cの拡張機能</li><li>TR 24731-1: C言語ライブラリの拡張機能 その1：境界チェックインターフェース</li><li>TR 24731-2: C言語ライブラリの拡張機能 その2：動的割り当て関数</li><li>TR 24732: 10進浮動小数点演算をサポートするプログラミング言語Cの拡張機能</li><li>WG14はC11という名前でC規格の改訂を終了しました。規格改訂のためのチャーターには行われたことのルールが書かれています。</li><li>TR 24747: プログラミング言語 C - 数学的特殊関数に対応するためのC言語ライブラリの拡張機能</li><li>C99規格の根拠を公開しています。</li></ul><p>その他に利用できる情報は:</p><ul><li>WG文書登録簿に含まれる文書</li><li>新しいWGのWiki（保護されており、メンバーのみが閲覧できます）</li><li>WGの内部情報（保護されており、メンバーのみが閲覧できます）</li><li>WG開催情報</li><li>WG14 ビジネスプランとコンバナーズレポート2012</li><li>ワーキンググループスタンディングドキュメント 1, メール・ミーティング情報</li><li>ワーキンググループスタンディングドキュメント 2, インフォーマル研究会組織情報</li><li>ワーキンググループスタンディングドキュメント 3, C11の旧DRプロセスに当てはまらない提案の一部リスト</li><li>ISO/IEC 2382:2015 情報技術 - 語彙（自由に使える標準語）</li><li>お問い合わせ</li></ul><p>詳細な情報をお求めの方、または参加をご希望の方は、各国の会員団体またはWGの連絡先のいずれかにご連絡ください。</p>",8),_=[n];function C(o,s,p,c,r,d){return l(),t("div",null,_)}const G=i(a,[["render",C]]);export{W as __pageData,G as default};
